const TodoList = ({ todos, onDelete }) => {
  return (
    <div>
      <ul>
        {todos.map((todo) => (
          <li key={todo.id}>
            <span>{todo.value}</span>
            <button type="button" onClick={() => onDelete(todo.id)}>
              delete
            </button>
          </li>
        ))}
      </ul>
      <button type="button" onClick={() => onDelete("all")}>
        Delete All
      </button>
    </div>
  );
};

export default TodoList;
